#include <iostream>
#include <vector>

using namespace std;

class Solution {
public:
    int numIslands(vector<vector<char>>& grid) {
        if (grid.size() == 0)
            return 0;
        
        int res = 0;
        for (int i = 0; i < grid.size(); i++) {
            for (int j = 0; j < grid[i].size(); j++) {
                if (grid[i][j] == '1') {
                    res++;
                    expand(grid, i, j);
                }
            }
        }
        return res;
    }

private:
    void expand(vector<vector<char>>& grid, int r, int c) {
        if (grid[r][c] == '0')
            return;
        
        grid[r][c] = '0';
        if (r - 1 >= 0)
            expand(grid, r - 1, c);
        if (c - 1 >= 0)
            expand(grid, r, c - 1);
        if (r + 1 < grid.size())
            expand(grid, r + 1, c);
        if (c + 1 < grid[0].size())
            expand(grid, r, c + 1);
    }
};

